const Post = () => {
  const router = useRouter();

  console.log(router.co);

  return (
    <Layout>
      <h2>
        post
        {router.query.id}
      </h2>
      <p>
        this is post #
        {router.query.title}
      </p>
    </Layout>
  );
};

